// React
import React, { Fragment } from "react";

import { Card } from "antd";

const OrderedList = ({ data }) => {
  return (
    <Fragment>
      {data.map(data => (
        <Card title={data.ordered_items}></Card>
      ))}
    </Fragment>
  );
};

export default OrderedList;
